from collections import defaultdict, deque
from typing import List


class Solution:
    def numBusesToDestination(self, routes: List[List[int]], source: int, target: int) -> int:

        if source == target:
            return 0

        graph = defaultdict(list)

        for i, route in enumerate(routes):
            for stop in route:
                graph[stop].append(i)

        visited = set()
        bfs = deque()
        bfs.append((source, 0))

        while bfs:
            curr, dist = bfs.popleft()
            if curr == target:
                return dist
            dist += 1
            for i in graph[curr]:
                if i not in visited:
                    for stop in routes[i]:
                        bfs.append((stop, dist))
                    visited.add(i)

        return -1


class Solution2:
    def numBusesToDestination(self, routes: List[List[int]], source: int, target: int) -> int:

        if source == target:
            return 0

        stops = {}
        graph = defaultdict(list)

        for curr, route in enumerate(routes):
            for stop in route:
                if stop in stops:
                    for neib in stops[stop]:
                        graph[curr].append(neib)
                        graph[neib].append(curr)
                    stops[stop].append(curr)
                else:
                    stops[stop] = [curr]

        targs = set()
        if target in stops:
            targs = set(stops[target])
        else:
            return -1

        bfs = deque()
        used = set()
        for route in stops[source]:
            bfs.append((route, 1))
            used.add(route)

        while bfs:
            curr, qty = bfs.popleft()
            if curr in targs:
                return qty
            qty += 1
            for nxt in graph[curr]:
                if nxt not in used:
                    bfs.append((nxt, qty))
                    used.add(nxt)

        return -1


